import ExpenseItem from "./components/ExpenseItem";
import "./Expenses.css";

function Expenses(props) {
  return (
    <div className="expenses">
      {props.items.map(({ title, amount, date }) => {
        return <ExpenseItem title={title} amt={amount} date={date} />;
      })}
    </div>
  );
}

export default Expenses;
